// Imports from MUI lib
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Button from '@mui/material/Button';
import React from 'react'
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import TabPanel from '@mui/lab/TabPanel';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
//import TabIndicator from '@mui/lab/TabIndicator';
import { Link } from 'react-router-dom';

import './Navbar.css'
// Create navbar
const pages = ['About', 'Projects', 'Contact'];

function Navbar() {
    const [value, setValue] = React.useState('one');

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (
        <TabContext>
            <Box sx={{ width: '100%' }}
                 display="flex"
                 justifyContent="center"
                 alignItems="center"
                 width="100%">
                 <div><img src='logo.png' width='50' height='50' alt='logo'/></div>
                 <Typography
                        variant='h6'
                        noWrap
                        component='a'
                        href='/'
                        sx={{
                            mr: 1.5,
                            display: { xs: 'none', md: 'flex' },
                            fontFamily: 'monospace',
                            fontWeight: 700,
                            letterSpacing: '.2rem',
                            color: 'inherit',
                            textDecoration: 'none',
                        }}
                    >
                        &nbsp;Kfir Tayar {/* Code for one space: &nbsp;*/}
                </Typography>
                <Tabs
                    value={false}
                    aria-label="wrapped label tabs example"
                >
                    {pages.map((page) => (
                        <Tab key={page} label={page} component={Link} to={`/${page.toLowerCase()}`} />
                    ))}
                </Tabs>
            </Box>

            {pages.map((page) => (
                <TabPanel key={page} value={`/${page.toLowerCase()}`}>
                    {/!* Content for each page *!/}
                    <div>{page} Page Content</div>
                </TabPanel>
            ))}
        </TabContext>
    );
}
export default Navbar;
